import React from 'react';
import BasicTextFields from './TextField';
import BasicSelect from './Select';
import BasicDatePicker from'./Data'


// import { Container } from './styles';

function FormCadastro() {
  return (
      <>
      <BasicTextFields/>
      <BasicSelect/>
      <BasicDatePicker/>


      </>
  );
}

export default FormCadastro;
